(6, 'ính chất ba đường trung tuyến của tam giác', '- Ba đường trung tuyến luôn cắt nhau tại một điểm.\n- Điểm đó gọi là trọng tâm của tam giác.\n- Trọng tâm chia trung tuyến thành 2 đoạn có tỷ lệ 2:1.\n\nGhi nhớ: Khi vẽ trung tuyến phải xác định trung điểm cạnh trước.', 1, 87, 0, 0, 3, 0, 0, '[]', '[]', '2025-11-20 14:23:27', '2025-11-27 19:21:38', NULL),
(7, 'Kể về một ngày đi học', 'Sáng nay mình đến trường hơi muộn vì trời mưa. \nTiết đầu tiên là Ngữ văn, cô cho cả lớp luyện viết đoạn văn miêu tả. \nBuổi chiều học Tin học và Giáo dục công dân, nhìn chung hôm nay khá nhẹ nhàng.', 7, 1003, 0, 0, 1, 1, 0, '[]', '[]', '2025-11-20 14:37:01', '2025-11-27 19:21:44', NULL),
(8, 'Tường thuật buổi học', 'Hôm nay lớp mình học bài “Phép nhân phân số”. Ban đầu mình thấy khá khó, \nnhưng sau khi cô giáo đưa ra nhiều ví dụ minh họa thì mình hiểu rõ hơn. \nCuối buổi học cô cho bài tập về nhà gồm 5 câu, mình sẽ cố gắng hoàn thành hết.', 211, 122, 0, 0, 1, 1, 1, '[]', '[]', '2025-11-23 09:29:46', '2025-11-27 19:21:42', NULL),
(9, '<script>alert(\"1\")</script>', 'aaaaádsadasdasdadadas', 211, 122, 0, 0, 0, 0, 0, '[]', '[]', '2025-11-23 09:30:29', '2025-11-27 19:19:21', '2025-11-27 19:19:21');
