INSERT INTO `submissions` (`id`, `assignmentId`, `studentId`, `content`, `mcqAnswers`, `grade`, `feedback`, `status`, `submittedAt`, `gradedAt`, `gradedBy`, `isLate`, `attemptNumber`, `createdAt`, `updatedAt`, `deletedAt`) VALUES
(6, 326, 116, 'Hôm nay em được thực hành lắp một mạch điện đơn giản gồm công tắc, bóng đèn và nguồn điện. \r\nEm đã học được cách đọc sơ đồ mạch, cách nối dây đúng kỹ thuật và kiểm tra mạch trước khi đóng điện. \r\nKhi mạch sáng đúng theo yêu cầu, em cảm thấy rất thích thú. \r\nBài thực hành giúp em hiểu rõ hơn về nguyên lý hoạt động của mạch điện và rèn luyện tính cẩn thận khi làm việc với điện.', NULL, 9.00, 'tốt', 'graded', '2025-11-27 19:58:10', '2025-11-27 20:02:33', 199, 0, 1, '2025-11-27 19:58:10', '2025-11-27 20:02:33', NULL),
(7, 328, 116, 'Trong bài học hôm nay, em đã tìm hiểu về vai trò quan trọng của điện năng trong đời sống và sản xuất. \r\nĐiện giúp con người thắp sáng, vận hành thiết bị gia dụng và tạo điều kiện cho học tập, làm việc hiệu quả hơn. \r\nTrong sản xuất, điện được dùng để chạy máy móc, dây chuyền tự động và góp phần tăng năng suất lao động. \r\nQua bài học, em hiểu rằng điện năng là nguồn năng lượng rất cần thiết, vì vậy chúng ta cần sử dụng điện tiết kiệm và an toàn.', NULL, 8.00, 'có cố gắng', 'graded', '2025-11-27 19:58:24', '2025-11-27 20:02:25', 199, 0, 1, '2025-11-27 19:58:24', '2025-11-27 20:02:25', NULL),
(8, 327, 116, 'Trong bài học, em đã tìm hiểu về nghề điện dân dụng và các công việc chính của nghề. \r\nNgười làm nghề điện dân dụng thực hiện lắp đặt, sửa chữa, kiểm tra và bảo trì các thiết bị điện trong gia đình. \r\nNghề này đòi hỏi tính chính xác, kiên nhẫn và hiểu biết về an toàn điện. \r\nQua bài học, em cảm thấy đây là một nghề rất gần gũi và quan trọng trong cuộc sống hằng ngày.', NULL, 7.50, 'còn phát huy', 'graded', '2025-11-27 19:58:36', '2025-11-27 20:02:14', 199, 0, 1, '2025-11-27 19:58:36', '2025-11-27 20:02:14', NULL),
(9, 329, 116, 'Bài học giúp em hiểu cách sử dụng thiết bị điện an toàn trong gia đình. \r\nEm đã biết không chạm tay ướt vào ổ cắm, không kéo dây điện mạnh và phải tắt thiết bị khi không sử dụng. \r\nNgoài ra, em còn biết phải kiểm tra dây dẫn, cầu dao và sử dụng cầu chì đúng loại. \r\nViệc sử dụng điện an toàn giúp phòng tránh cháy nổ và bảo vệ mọi người trong gia đình.', NULL, 9.50, 'tốt', 'graded', '2025-11-27 19:58:47', '2025-11-27 20:01:53', 199, 0, 1, '2025-11-27 19:58:47', '2025-11-27 20:01:53', NULL);
